public object TuBrandBrushes {
  public val lightBrushes: MisticaBrushes = MisticaBrushes().apply {
      backgroundContainerBrand = SolidColor(TuPaletteColor.tu_color_primary)
      backgroundBrand = SolidColor(TuPaletteColor.tu_color_primary)
      cardContentOverlay = LinearGradientWithAngle(
        angleInDegrees = 180F,
        colorStops = listOf(
          0.0F to TuPaletteColor.tu_color_black_0_alpha,
          0.3F to TuPaletteColor.tu_color_black_40_alpha,
          1.0F to TuPaletteColor.tu_color_black_70_alpha
        ))
      }

  public val darkBrushes: MisticaBrushes = MisticaBrushes().apply {
      backgroundBrand = SolidColor(TuPaletteColor.tu_color_darkModeBlack)
      backgroundContainerBrand = SolidColor(TuPaletteColor.tu_color_darkModeGrey)
      cardContentOverlay = LinearGradientWithAngle(
        angleInDegrees = 180F,
        colorStops = listOf(
          0.0F to TuPaletteColor.tu_color_black_0_alpha,
          0.3F to TuPaletteColor.tu_color_black_40_alpha,
          1.0F to TuPaletteColor.tu_color_black_70_alpha
        ))
      }
}

